import { NavLink } from "react-router-dom"

export default function NavBar() {
    const NavStyle = ({ isActive }) => {
        return {
            fontWeight : isActive ? 'bold' : ''
        }
    }

    return (
        <nav>
            <NavLink to='/'>Home</NavLink>
            <NavLink to='/about'>About</NavLink>
        </nav>
    )
}
